"use strict";
const UniformNode = require("./UniformNode.js");
class ArrayUniformNode extends UniformNode {
  constructor(nodes = []) {
    super();
    this.nodes = nodes;
  }
  getNodeType(builder) {
    return this.nodes[0].getNodeType(builder);
  }
}
ArrayUniformNode.prototype.isArrayUniformNode = true;
module.exports = ArrayUniformNode;
